@app.route("/heartbeat")
def heartbeat():
    return jsonify({"status": "healthy"})


# A request to add items to the catalog (use the request body to store data)
@app.route("/catalog/item", methods=["POST"])
def add_item(id, name, price, image):
    shopping_catalog.append({'id' : id, 'name' : name, 'price' : price, 'image' : image})
    return "Trueeeeeeee"


# A request to remove items from the catalog using an item id
@app.route("/catalog/item/<item_id>", methods=["DELETE"])
def remove_item(item_id):
    print('hi')

    shopping_catalog.remove(shopping_catalog[int(item_id)-1])
    return "Trueeeeeeee"



# A request to get all items in the catalog
@app.route("/catalog", methods=["GET"])
def get_items():
    return jsonify(shopping_catalog)


